declare module "*.svg" {
  const content: svg;
  export default content;
}

declare module "*.png" {
  const content: png;
  export default content;
}

declare module "*.gif" {
  const content: gif;
  export default content;
}

declare module "*.jpeg" {
  const content: jpeg;
  export default content;
}

declare module "*.jpg" {
  const content: jpg;
  export default content;
}

declare module "@commercetools/sdk-middleware-http";

declare module "@commercetools/sdk-middleware-auth";
